import React from 'react';

function GameList({ games }) {
  return (
    <ul>
      {games.map((game) => (
        <li key={game.id}>
          <a href={game.game_url} target="_blank" rel="noopener noreferrer">{game.title}</a> - {game.platform}
        </li>
      ))}
    </ul>
  );
}

export default GameList;
